function []=timestepplots(sprobs100,optweightfromAIC100,optweightfromAIC25,optweightfromAIC10,weightedsol100,weightedsol25,weightedsol10,Sweightedsol100,Sweightedsol25,Sweightedsol10,disttype)
points = 101;
sgrid=linspace(0,1,101);
% if disttype == 'Normal' 
    % cdfS100(1)=(1/101)*sprobs100(1);
    %     for i=2:points
    %         partialsumS=trapz(sgrid(1:i),sprobs100(1:i));
    %         cdfS100(i)=partialsumS;
    %     end
if strcmp(disttype,'OnePoint') == 1 || strcmp(disttype,'TwoPoints') ==1 
    cdfS100 = cumsum(sprobs100);
elseif strcmp(disttype,'Normal') == 1 || strcmp(disttype,'Uniform') ==1 || strcmp(disttype,'Bigaussian') ==1 
    cdfS100=cumtrapz(linspace(0,1,length(sprobs100)),sprobs100);
end

% end
% if disttype == 'Normal'
%     cdfS100=cumtrapz(linspace(0,1,length(sprobs100)),sprobs100)
% elseif disttype == 'OnePoint' || disttype == 'TwoPoints'
%     cdfS100 = cumsum(linspace(0,1,length(sprobs100)),sprobs100)
% end
% figure
% plot(linspace(0,1,points),cdfS100,'r')
% hold on
% plot(linspace(0,1,length(optweightfromAIC100)), cumsum(optweightfromAIC100),'b')
% hold on
% plot(linspace(0,1,length(optweightfromAIC25)), cumsum(optweightfromAIC25),'b')
% ylim([0 1])

figure
stairs(linspace(0,1,length(optweightfromAIC100)),cumsum(optweightfromAIC100),'-','MarkerSize',8,'LineWidth',2,'Color','blue')
hold on
stairs(linspace(0,1,length(optweightfromAIC25)),cumsum(optweightfromAIC25),'-','MarkerSize',8,'LineWidth',2,'Color','cyan')
hold on
stairs(linspace(0,1,length(optweightfromAIC10)),cumsum(optweightfromAIC10),'-','MarkerSize',8,'LineWidth',2,'Color','m')
    ylim([0 1])
    hold on
    plot(linspace(0,1,points),cdfS100,'-','MarkerSize',6,'LineWidth',2,'Color','red')
    xlabel('Sensitivity to Treatment {\it s}')
%ylabel('Cumulative Recovered Prop. of Pop.') %original version
ylabel('Cumulative Recovered Proportion')
%legend(Legend, 'FontSize',12,'Location','northwest')
legend('Recovered, 100 Time Steps','Recovered, 25 Time Steps','Recovered, 10 Time Steps','Original','Location','Southeast','FontSize',14)
set(gca,"FontSize",20)

figure
plot(linspace(0,50,100),weightedsol100,'d','LineWidth', 2,'MarkerSize',8,'Color','blue')
hold on
plot(linspace(0,50,100),Sweightedsol100,'LineWidth',2,'Color','blue')
hold on
plot(linspace(0,50,25),weightedsol25,'d','LineWidth', 2,'MarkerSize',8,'Color','cyan')
hold on
plot(linspace(0,50,25),Sweightedsol25,'LineWidth',2,'Color','cyan')
hold on
plot(linspace(0,50,10),weightedsol10,'md','LineWidth', 2,'MarkerSize',8)
hold on
plot(linspace(0,50,10),Sweightedsol10,'LineWidth',2,'Color','m')
legend('Synthetic Data, 100 Time Steps','Recovered Curve, 100 Time Steps','Synthetic Data, 25 Time Steps','Recovered Curve, 25 Time Steps','Synthetic Data, 10 Time Steps','Recovered Curve, 10 Time Steps','FontSize',14)
set(gca,"FontSize",20)
ylabel('Aggregated Tumor Volume')
xlabel('Time')

r100to25=length(optweightfromAIC25)/length(optweightfromAIC100);
r100to10=length(optweightfromAIC10)/length(optweightfromAIC100);


if strcmp(disttype,'OnePoint') == 1 || strcmp(disttype,'TwoPoints') ==1 
    figure
    yyaxis left
    stem(linspace(0,1,length(optweightfromAIC100)),optweightfromAIC100,'--o','LineWidth',2,'MarkerSize',8,'Color','#0072BD')
    hold on
    stem(linspace(0,1,length(optweightfromAIC25)),optweightfromAIC25*(r100to25),'--o','LineWidth',2,'MarkerSize',8,'Color','#6B9C28')
    hold on
    stem(linspace(0,1,length(optweightfromAIC10)),optweightfromAIC10*(r100to10),'--o','LineWidth',2,'MarkerSize',8,'Color','#E6AB1A')
    hold on
    ylabel('Recovered Proportion of Population')
    yyaxis right
    stem(linspace(0,1,101),sprobs100,'--o','LineWidth',2,'MarkerSize',8,'Color','#A2142F')
    ylabel('Original Proportion of Population')
    legend('Recovered, 100 Time Steps','Recovered, 25 Time Steps','Recovered, 10 Time Steps','Original','FontSize',14)
    set(gca,"FontSize",20)
    xlabel('Sensitivity to Treatment {\it s}')
elseif strcmp(disttype,'Normal') == 1 || strcmp(disttype,'Uniform') ==1 || strcmp(disttype,'Bigaussian') ==1 
